import './../css/setting.css';
import {Header} from "./header";
export class Setting extends React.Component{
    constructor() {
        super();
        this.state = {

        }
    }
    render() {
        return (
            <div id='setting'>
                <Header/>
                <div id="container">
                    <div id="title">
                        सेटिङ मिलाउनुहोस ।
                    </div>
                    <div id="item_list">
                        <div className='item'>
                            <table>
                                <tr>
                                    <td>आर्थिक बर्ष : </td>
                                    <td>
                                        <select>
                                            <option>78/79</option>
                                            <option>79/80</option>
                                            <option>80/81</option>
                                            <option>81/82</option>
                                            <option>82/83</option>
                                            <option>83/84</option>
                                            <option>84/85</option>
                                            <option>85/86</option>
                                            <option>86/87</option>
                                            <option>87/88</option>
                                        </select>
                                    </td>
                                </tr>
                            </table>
                        </div>
                    </div>
                    <button>अपडेट गर्नुहोस </button>
                </div>
            </div>
        );
    }
}
